query:
/*+ NoMergeJoin(mk t) NoNestLoop(mk t mi_idx) */ select count(*)
from movie_keyword AS mk
inner join title AS t
on t.id = mk.movie_id AND mk.keyword_id < 55192 AND t.kind_id < 7 AND t.production_year < 2008
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id < 101;
